            return w
        elif r <= 8:
            return (w * (1 + (r - 3) / 5.0)) * (0.0336 * (r - 3) - 0.0009)
        else:
            return (w * (1 + (r - 8) / 5.0)) * (0.0154 * (r - 8) - 0.0013)

    def lombardi(w, r):
        return w * (1.0 + (r - 1.0) / (170.0 + 0.2 * r))

    if r == 1:
        return w
    elif r == 0:
        return 0
    else:
        return max(int(round(epley(w, r))), int(round(mcglothin(w, r))), int(round(lombardi(w, r))))

